function toastSuccess(texto, tiempo) {
  toastClear();
  tiempo = !!tiempo ? tiempo : 1900;
  new Notify({
    status: 'success',
    text: `<img alter='UNIANDES' class='float-img-logo-blanco'/>
              <div class='next-logo-toast'>
              ${texto}
              </div>`,
    effect: 'fade',
    speed: 370,
    customClass: null,
    customIcon: null,
    showIcon: true,
    showCloseButton: true,
    autoclose: true,
    autotimeout: tiempo,
    gap: 20,
    distance: 20,
    type: 3,
    position: 'right top'
  })
}
