function toastHtml(html, textoBotonAceptar) {
  try {
    textoBotonAceptar = !textoBotonAceptar ? "Ok" : textoBotonAceptar;
    Swal.fire({
      html: `<img alter='UNIANDES' class='logo-azul-163' />
    <div class='mb-3 text-justify-all'>${html}</div>`,
      showCancelButton: false,
      confirmButtonText: textoBotonAceptar,
    });
  } catch (error) {
    console.warn(error);
  }
}
function toastPreguntar(mensaje, textoBotonAceptar, textoBotonCancelar) {
  return new Promise(resolve => {
    try {
      textoBotonAceptar = !textoBotonAceptar ? "Si, Continuar" : textoBotonAceptar;
      textoBotonCancelar = !textoBotonCancelar ? "Cancelar" : textoBotonCancelar;
      Swal.fire({
        html: `<img alter='UNIANDES' class="logo-azul-163" style='margin-bottom:10px;margin-top:5px'/>
                    <div class='mb-1 text-justify-all'>
                        ${mensaje}
                    </div>`,
        showCancelButton: true,
        confirmButtonText: textoBotonAceptar,
        cancelButtonText: textoBotonCancelar
      }).then((result) => {
        resolve(result.isConfirmed);
      });
    } catch (error) {
      resolve(false);
      console.log(`${error}`);
    }
  });
}
